function select_type(Node, element, value) {
  Node.type = value;
  element.value = value;
}

function changesEq3(e, Node, volume, volume_value, parameter) {
  const num1 = Number(e);
  switch (parameter) {
    case "low_freq": {
      Node.lowFrequency.value = num1;
      break;
    }
    case "hi_freq": {
      Node.highFrequency.value = num1;
      break;
    }
    case "low_gain": {
      Node.low.value = num1;
      break;
    }
    case "mid_gain": {
      Node.mid.value = num1;
      break;
    }
    case "hi_gain": {
      Node.high.value = num1;
      break;
    }
    case "q": {
      Node.Q.value = num1;
      break;
    }
    case "frequency": {
      Node.frequency.value = num1;
      break;
    }
    case "detune": {
      Node.detune.value = num1;
      break;
    }
    case "gain": {
      Node.gain.value = num1;
      break;
    }
    default: { console.log("default changes EQ3"); break; }
  }
  volume_value.innerHTML = Math.round(`${e}`);
  volume.value = Math.round(`${e}`);
}

function changesVolume(e, Node, volume, volume_value) {
  const num1 = Number(e);
  if (num1 <= -40) {
    Node.volume.value = -100;
    volume_value.innerHTML = -100;
    volume.value = -100;
    MixEventObj.logIntoListaNewValue(List, Tone.now().toFixed(4), "player_1_volume", -100);
    //CORREGIR player_1_volume POR LO QUE VENGA VOLUME
  }
  else {
    // Node.volume.value = num1;
    volume_value.innerHTML = Math.round(`${e}`);
    volume.value = Math.round(`${e}`);
    Node.volume.rampTo(num1, 0.30);
    MixEventObj.logIntoListaNewValue(List, Tone.now().toFixed(4), "player_1_volume", num1);
  }
}

