function table_to_String(lista) {
  var cadena = "atTime" + ", " + "element" + ", " + "action" + ", " +
    "newValue" + ", " + "rampTime" + "\n";
  var temp = "";
  for (let i = 0; i < lista.length; i++) {
    temp = lista[i].atTime + ", " + lista[i].element + ", " + lista[i].action
      + ", " + lista[i].newValue + ", " + lista[i].rampTime + "\n";
    cadena = cadena.concat("", temp);
  }
  return cadena;
}

function channel_x_filter_1_select(e, Node) {
  //diferenciar entre su uso desde addevent y desde load mix
  switch (e) {
    case "lowpass":
    case "highpass":
    case "bandpass":
    case "notch":
    case "allpass":
      {
        Node.type = e;
        channel_1_filter_eq_type = "allpass";
        // MixEventObj.logIntoListaNewValue(List, Tone.now().toFixed(4), "channel_1_filter_select", e);
        if (channel_1_filter_eq_type == "on") {
          hide_all_EQ_divs("1");
          channel_1_allpass_controls_div.style.display = "block";
        }
        break;
      }
    case "lowshelf":
    case "highshelf":
      {
        Node.type = e;
        channel_1_filter_eq_type = "shelf";
        //    MixEventObj.logIntoListaNewValue(List, Tone.now().toFixed(4), "channel_1_filter_select", e);
        if (channel_1_filter_eq_type == "on") {
          hide_all_EQ_divs("1");
          channel_1_shelf_controls_div.style.display = "block";
        }
        break;
      }
    case "peaking":
      {
        Node.type = e;
        channel_1_filter_eq_type = "peaking";
        //  MixEventObj.logIntoListaNewValue(List, Tone.now().toFixed(4), "channel_1_filter_select", e);
        break;
      }
    case "empty": {
      channel_1_filter_eq_type = "empty";
      Node.set({
        frequency: 20000,
        type: "lowpass",
        Q: 0,
        gain: 0,
        rolloff: -96,
      });
      //  MixEventObj.logIntoListaNewValue(List, Tone.now().toFixed(4), "channel_1_filter_select", "empty");
      break;
    }
    default:
      { alert(" EQ1 DEFAULT channel_1_filter_select switch"); }
  }
}

